import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ChoreList from './components/ChoreList';
import ChoreDetail from './components/ChoreDetail';
import ChoreCreate from './components/ChoreCreate';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ChoreList />} />
        <Route path="/chore/:id" element={<ChoreDetail />} />
        <Route path="/chore-create" element={<ChoreCreate />} />
      </Routes>
    </Router>
  );
}

export default App;
